import Dashboard from "views/Dashboard.js";
console.log("Dashboard:", Dashboard);
var routes = [
  {
    path: "/dashboard",
    name: "Dashboard",
    rtlName: "dashboard",
    icon: "tim-icons icon-chart-pie-36",
    component: Dashboard,
    layout: "/admin",
  },
];
export default routes;
